import React from 'react';
import { createRoot } from 'react-dom/client'; // Usando la nueva API de React 18
import './index.css';
import './global.css'; // Asumiendo que también quieres incluir global.css
import App from './App';
import reportWebVitals from './reportWebVitals';
import { store } from './pages/store/store'; // Importación del store de Redux
import { Provider } from 'react-redux';
import { BrowserRouter } from 'react-router-dom'; // Importación de BrowserRouter

const container = document.getElementById('root');
const root = createRoot(container); // Creando el root con la nueva API

root.render(
  <React.StrictMode>
    <Provider store={store}>
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </Provider>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
